function wSetSessionId(Wasdi, sSessionId)% Set the session ID% Syntax% wSetSessionId(Wasdi, sSessionId)% % INPUT%    Wasdi: Wasdi object created after the wasdilib call%    sSessionId: the session ID  if exist("Wasdi") < 1     disp('Wasdi variable does not existst')    return   end      Wasdi.setSessionId(sSessionId)   end